  max-width: 8rem;
}

.learn-img {
  max-width: 8rem;
}

.ts-svg {
  fill: #007acc;
}

/* Variables */
/* Base */
.event p {
  font-weight: 300;
}

strong {
  font-weight: 600;
}

#timeline-content {
  margin-top: 50px;
  text-align: center;
}

/* Timeline */
.timeline {
  border-left: 4px solid #572e51;
  border-bottom-right-radius: 4px;
  border-top-right-radius: 4px;
  background: fade(white, 3%);
  color: fade(white, 80%);
  margin: 50px auto;
  letter-spacing: 0.5px;
  position: relative;
  line-height: 1.4em;
  font-size: 1.03rem;
  padding: 50px;
  list-style: none;
  text-align: left;
  font-weight: 100;
  max-width: 60%;
}
.timeline .timeline_item {
  letter-spacing: 1.5px;
  font-weight: 100;
  font-size: 1.4em;
}
.timeline .event {
  border-bottom: 1px dashed fade(white, 10%);
  padding-bottom: 25px;
  margin-bottom: 50px;
  position: relative;
}
.timeline .event:last-of-type {
  padding-bottom: 0;
  margin-bottom: 0;
  border: none;
}
.timeline .event:before, .timeline .event:after {
  position: absolute;
  display: block;
  top: 0;
}
.timeline .event:before {
  left: -217.5px;
  color: fade(white, 40%);
  content: attr(data-date);
  text-align: right;
  font-weight: 100;
  font-size: 0.9em;
  min-width: 120px;
}
.timeline .event:after {
  box-shadow: 0 0 0 4px fade(#572e51, 100%);
  left: -57.85px;
  background: #50907b;
  border-radius: 50%;
  height: 11px;
  width: 11px;
  content: "";
  top: 5px;
}

/* article display helpers*/
@media screen and (min-width: 1260px) {
  .is-flex > .section-desktop {
    max-width: 30rem;
  }
}

@media screen and (min-width: 862px) {
  .section-desktop {
    padding: 1rem 0.5rem;
  }
}
@media screen and (max-width: 861px) {
  .section-desktop {
    padding: 0.5rem 0.1rem 1rem 0.1rem;
  }
}

.section-desktop > article {
  min-height: 44rem;
}

