}

.pagination-link.is-current {
  background-color: #372048;
}
.pagination-link.is-current:hover {
  color: #9eff9a;
}

.pagination-next {
  border-color: #3c3e40;
}
.pagination-next:hover {
  background-color: #EDE1FA;
}

.project {
  background-color: transparent;
