  margin-right: auto;
}

.is-previous {
  position: absolute;
  left: 0;
  z-index: 1;
}

.is-next {
  position: absolute;
  right: 0;
  z-index: 1;
}

/* purgecss start ignore */
code.hljs {
  font-family: "PT Mono";
}

pre {
  border-radius: 1rem;
  border: solid #3c3e40 0.1rem;
  background-color: #2F3133;
  color: #9eff9a;
  scrollbar-width: none;
}
pre::-webkit-scrollbar {
  display: none;
}

.hljs-comment, .hljs-quote {
  color: #5c6370;
